import React, { Component } from 'react'

const data=[
    {id:1,title:'qqq',sad:'dadas'},
    {id:2,title:'qwww',sad:'daaaas'},
    {id:3,title:'www',sad:'dssss'}
 ]
export default class Detail extends Component {
   
    render() {
    return (
      <ul>
          <li>'id:' +  +  data[].id</li>
          <li> 'title:' + data[].id</li>
          <li> 'sad:'  +  data[].id   </li>
      </ul>
    )
  }
}
